description:
1. Grab the rubber snake (in the seat), string (hanging from the luggage areas), and ice (by the water bottles); 
2. Click the red overhead call button; 
3. Click the luggage area directly above the call button; 
4. Click the stewardess's butt; 
5. Click the Crew's luggage area (towards the front); 
6. Take the clothes out of the Crew's luggage area; 
7. Open the luggage area from no. 3; 
8. Click her clothes in inventory and then the red bag in the luggage area; 
9. Once she walks forward with the drinks, put the ice in the cup; 
10. Click the snake and the string; 
11. Click the sauce and put it on the guy's head (on the left); 
12. Click the toilet paper, then click the toilet paper in your inventory and then click on the guy; 
13. Put the Tobasco sauce in the lemonade once the stewardess disappears; 
14. Click the water; 
15. Click the bathroom door (it's a small, thin, white strip on what looks like a corner near the Toilet sign); 
16. Get the glue on the shelf by the water bottles; 
17. Put it on the yellow seat on the left.
18. watch the cut sceen
19. The flight atendant will come sit with you
20. Game over congrats you won. Try going back and getting a high score and beating your last one. 

p.s there is a time limit read and watch the videos a couple times before you come in for the high scores.

Thanks for watching and please rate comment and subscribe for more awesome videos. If you want to see me make a specific walkthrough video post it on a personal message or you can put it the comments. Thanks for watching hope it helped you.
